import {Nav} from "react-bootstrap";
import PlaylistAddIcon from '@mui/icons-material/PlaylistAdd';
import AnnouncementIcon from '@mui/icons-material/Announcement';
import AccessibilityNewIcon from '@mui/icons-material/AccessibilityNew';
import NewReleasesIcon from '@mui/icons-material/NewReleases';
import PersonIcon from '@mui/icons-material/Person';

export default function Sidebar() {
    const navLinkClass = "list-group-item list-group-item-action list-group-item-light p-4";
    const linkPages = [{name: "Explore", icon: <NewReleasesIcon />, to: '/'}, {
        name: "News",
        icon: <AnnouncementIcon/>,
        to: '/'
    }, {
        name: "Profile",
        icon: <PersonIcon/>,
        to: '/'
    }, {name: "Friend", icon: <AccessibilityNewIcon/>, to: '/'}];

    return (
        <div className="border-end bg-white h-100  position-fixed" id="sidebar-wrapper">

            <Nav className="list-group list-group-flush  h-100">
                {linkPages.map(nav => {
                    return (
                        <Nav.Link className={navLinkClass}>
                            <div>{nav.icon }</div>{nav.name}
                        </Nav.Link>
                    );
                })}

            </Nav>
        </div>
    );
};
